import { useEffect, useState } from "react";
import { Link } from "react-router-dom";

const ReviewList = () => {

    const [review, setReview] = useState(null)

    useEffect( () => {
        fetch("http://localhost:8000/blogs")
            .then(res => {
                return res.json()
            })
    })

    return (
        <div>
            <h2>Review List</h2>



            <Link to="/create">
                <button>Write a review</button>
            </Link>

        </div>
    );
}
 
export default ReviewList;
